const el = $('#el');
const test = $('#hero');
el.hide();
test.click(function(){
    const target = $(this).data('open');
    $(target).slideToggle(function(){
        if(el.is(':hidden')) {
            test.find('.iconDown').html("&#x25BE;");
        } else {
            test.find('.iconDown').html("&#x25B4;");
        }
    });
});
